package com.basic;

/**
 * Prints equivalent ASCII character(s) of specified number
 * 
 * @author Allianz3076
 *
 */
public class AsciiPrinter {

	/**
	 * @param args
	 */
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for(int i=0; i <=255; i++) {
			System.out.write(i);
		}
	}

}
